import styles from "./CartItem.module.css";

const CartItem = ({ cart }) => {
  return (
    <tr>
      <td className={`${styles["cart-product-img"]}`}>
        <img
          src={cart.product.img1}
          alt={cart.product.name}
          className="img-fluid "
        />
      </td>
      <td>{cart.product.name}</td>
      <td>{cart.product.price}</td>
      <td>{cart.quantity}</td>
      <td>{cart.total}</td>
      <td>Remove</td>
    </tr>
  );
};

export default CartItem;
